function NavBar({halls, setSelectedHall})
{
    return (
        <>
        <Toolbar />
        <Divider />
        <List>
        {halls.map((text) => (
            <>
            <ListItem key={text} disablePadding>
                <ListItemButton onClick={() => setSelectedHall(text)}>
                <ListItemText primary={text} />
                </ListItemButton>
            </ListItem>
            <Divider />
            </>
            ))}
        </List>
        </>
    );
}

export default NavBar;
